  false,\n\t\"url\": null,\n\t\"notes\": \"The USFWS and North Dakota Game and Fish
  Department sampled Northern pike, walleye, yellow perch and white bass within the
  boundary of Lake Alice NWR in North Dakota. The sampling effort was collaborative,
  and was desired due to the increased size of Lake Allice and it's recent connectivity
  with Devils Lake, and well known world class fishery. Also, the USFWS is opening
  a portion of the refuge to ice fishing only, and it was desired to include some
  baseline fish population inforamtion at the Refuge. Resource objective - To sample
  fish populations in Lake Alice NWR prior to being opend to ice fishing which is
  scheduled to occur in Winter 2015 - 2016.\",\n\t\"license_title\": \"License Not
